def solution():
    """John is very unfit and decides to work up to doing a push-up. He trains 5 days a week for them and starts with wall push-ups. He adds 1 rep a day and once he gets to 15 reps he will start training high elevation push-ups. and then low elevation push-ups, and finally floor push-ups. How many weeks will it take him to get to floor push-ups?"""
    reps_per_day = 1
    days_per_week = 5
    starting_reps = 0
    high_elevation_reps = 15
    low_elevation_reps = 25
    training_weeks = 0
    while starting_reps < low_elevation_reps:
        for i in range(days_per_week):
            starting_reps += reps_per_day
        if starting_reps >= low_elevation_reps:
            break
        elif starting_reps >= high_elevation_reps:
            reps_per_day = 2
        else:
            reps_per_day = 1
        training_weeks += 1
    result = training_weeks
    return result

def solution():
    """Tony has to run several errands in a day. He needs to drive 10 miles to get groceries, 15 miles to get a haircut, and 5 miles to go to a doctor's appointment. How many miles will Tony have driven when he is halfway through driving around for his errands?"""
    total_miles = 10 + 15 + 5
    halfway_miles = total_miles / 2
    miles_driven = 0
    errands = ['groceries', 'haircut', 'doctor']
    for errand in errands:
        if miles_driven + halfway_miles > total_miles // 2:
            break
        if errand == 'groceries':
            miles_driven += 10
        elif errand == 'haircut':
            miles_driven += 15
        elif errand == 'doctor':
            miles_driven += 5

    result = miles_driven
    return result

def solution():
    """Mariel is a dog walker. While walking her pack of dogs, she gets tangled up in the leashes of another dog walker and their 3 dogs. There are 36 legs tangled up in leashes. How many dogs is Mariel walking?"""
    mariel_dogs = 0
    for i in range(1, 10):
        for j in range(1, 10):
            if (4*i) + (4*j) == 36 and i != j:
                mariel_dogs = i
    result = mariel_dogs
    return result

def solution():
    """Wally buys bears at the park. A bear is priced at $4.00 for the first bear and a discount of 50 cents per bear is given after that. How much does Wally pay for 101 bears?"""
    first_bear_price = 4.00
    discount_per_bear = 0.50
    total_bears = 101
    total_price = 0
    for i in range(total_bears):
        if i == 0:
            total_price += first_bear_price
        else:
            total_price += first_bear_price - (discount_per_bear * i)

    result = total_price
    return result

def solution():
    """Susy goes to a large school with 800 students, while Sarah goes to a smaller school with only 300 students. At the start of the school year, Susy had 100 social media followers. She gained 40 new followers in the first week of the school year, half that in the second week, and half of that in the third week. Sarah only had 50 social media followers at the start of the year, but she gained 90 new followers the first week, a third of that in the second week, and a third of that in the third week. After three weeks, how many social media followers did the girl with the most total followers have?"""
    susy_followers = 100 + 40 + 20 + 10  # total followers of Susy after three weeks
    sarah_followers = 50 + 90 + 30 + 10  # total followers of Sarah after three weeks
    if susy_followers > sarah_followers:
        result = susy_followers
    else:
        result = sarah_followers
    return result

def solution():
    """Janice opened an art book that she had found in the library and found 5 drawings on the first page. After opening the first ten pages, she realized that the number of drawings on each page increased by five after every page. How many drawings were in the first five pages?"""
    first_page_drawings = 5
    increase_per_page = 5
    total_drawings = 0
    for i in range(1, 11):
        if i <= 5:
            total_drawings += first_page_drawings
        else:
            total_drawings += first_page_drawings + increase_per_page * (i-5)

    result = total_drawings
    return result

def solution():
    """Nina loves to travel. She tries to travel at least 400 kilometers in one month outside of her home country. Every second month she does twice that distance. If she were able to keep up with her resolution, how many kilometers would she travel during 2 years?"""
    monthly_goal = 400
    every_other_month_goal = monthly_goal * 2
    total_distance = 0
    for i in range(24):
        if i % 2 == 1:
            total_distance += every_other_month_goal
        else:
            total_distance += monthly_goal

    result = total_distance
    return result

def solution():
    """A carton of ice cream contains 10 scoops each. Mary has 3 cartons of ice cream, one chocolate, one strawberry and one vanilla. Ethan wants one scoop of vanilla and one of chocolate. Lucas, Danny and Connor all want 2 scoops of chocolate. Olivia would like a scoop of vanilla and one of strawberry. Shannon wants twice as much as Olivia. How many scoops of ice cream will be left?"""
    carton_size = 10
    mary_ice_cream = {"chocolate": 1, "strawberry": 1, "vanilla": 1}
    ethan_ice_cream = {"chocolate": 1, "vanilla": 1}
    lucas_ice_cream = {"chocolate": 2}
    danny_ice_cream = {"chocolate": 2}
    connor_ice_cream = {"chocolate": 2}
    olivia_ice_cream = {"vanilla": 1, "strawberry": 1}
    shannon_ice_cream = {"vanilla": 2, "strawberry": 2}
    total_scoops = sum(mary_ice_cream.values()) + sum(ethan_ice_cream.values()) + sum(lucas_ice_cream.values()) + sum(danny_ice_cream.values()) + sum(connor_ice_cream.values()) + sum(olivia_ice_cream.values()) + sum(shannon_ice_cream.values())
    total_scoops_left = (len(mary_ice_cream) * carton_size) - total_scoops
    result = total_scoops_left
    return result

def solution():
    """Jason has six fish in his aquarium. He realizes that every day the number of fish doubles. On the third day he takes out one-third of the fish. On the fifth day he takes out one-fourth of the fish. On the seventh day he adds 15 more fish. How many fish in total does he have?"""
    num_fish = 6
    for i in range(1, 8):
        num_fish *= 2
        if i == 3:
            num_fish = int(num_fish * (2/3))
        elif i == 5:
            num_fish = int(num_fish * (3/4))
        elif i == 7:
            num_fish += 15
    result = num_fish
    return result

